import React, {Component} from 'react';

const imageList = ({images}) => {
    const getImages = images.map(image => {
        return (
            <div>
                <img src={images.url.small} alt=""/>
            </div>
        )
    })
    return (
        <div>
            <getImages/>
        </div>
    );
}




export default Images;
